import React from 'react'

import {
    Container,
    HorizontalLine,
    VerticalLine
} from './styled'

const BackgroundLinesComponent = () => {   

    const renderHorizontalLines = () => {
        let item = [];
        for (let i = 0; i < 8; i++) {
          item.push(
            <HorizontalLine 
              key={ i }
            />
          );
        }
        return item;
    };

    const renderVerticalLines = () => {
        let item = [];
        for (let i = 0; i < 8; i++) {
          item.push(
            <VerticalLine 
              key={ i }
            />
          );
        }
        return item;
    };

    return (
        <Container>
            {renderHorizontalLines()}
            {renderVerticalLines()}
        </Container>
    )
}


export default BackgroundLinesComponent;
